q($,"aBW","afO",()=>A.d4("Qurban Penuh Cinta","assets/img/infaq/qurban.jpg","Bersama Anak Yatim & Dhuafa Pondok Tahfidz Quran Al Mukarromah , Cianjur.\nQurban Adalah bukti cinta seorang hamba kepada Allah SWT. Setetes darah dari hewan qurban bisa jadi saksi yang mengantarkan kita ke Surga-Nya\n\nYuk Ikutan Patungan Mulai 100 Ribuan Untuk Qurban atas nama Anak Yatim dan Dhuafa yang belum pernah berqurban ! \n\nWujudkan Impian Qurban Jadi Kenyataan \u2764\ufe0f\n\nMulai  100 Ribuan sudah Ikut Partisipasi Donasi Qurban atas nama Anak Yatim & Dhuafa Berkah Sahabat Yatim\n  ","/qurban",1e5))
q($,"aBO","afN",()=>A.d4("Titip Qurban Bersama Yatim & Dhuafa","assets/img/infaq/qurban_beli.jpg","Titip Qurban Bersama Yatim & Dhuafa Berkah Sahabat Yatim\n\nYuk siap-siap pilih-pilih  qurbannya! Apalagi, kalau  mau  Titip Qurban di Berkah Sahabat Yatim! \u2728\n\nBerqurban memiliki banyak keutamaan yang terkandung di dalamnya. Namun tahukah Sahabat, ada qurban yang lebih utama. Yaitu qurban bersama anak-anak yatim & dhuafa. \n\nKenapa lebih utama? \n\nSebab, jika kita melaksanakan qurban bersama yatim & dhuafa, kita akan mendapatkan 3 keutamaan sekaligus. Keutamaan-keutamaan tersebut antara lain : \n\n1. Mendapat pahala melaksanakan qurban \n\n2. Dapat membahagiakan anak yatim dan dhuafa \n\n3. Mendapat kebaikan doa anak-anak yatim & dhuafa\n\nMudah kan? Pastinya! Pahalanya dapat, praktisnya dapat! \ud83e\udd70\ud83e\udd73 \n\nMARI BERQURBAN SEDIA DOMBA QURBAN 2,5 JT/ ekor, Persediaan Terbatas Unt Qurban Terbaik Anda !\n","/beli-domba-qurban",25e5))
